INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'product', 0, 1, 1, 'und', 0, '" With HD 1080p resolution and SimpLink connectivity, the 42PW350 3D Plasma HDTV from LG Electronics lets you tap into the virtual limitless possibilities of accessing movies, shows and info directly from the Internet. The 42PW350 yields images that truly show off any source material, be it Blu-ray movies, broadcast and cable TV, or video games. LG''s proprietary technologies also ensure that whatever you''re watching comes across in rich, detailed color. The 42PW350 TV''s high contrast ratio and low response time makes the unit capable of being the centerpiece in any home entertainment system.\r\n\r\nThe TV comes with a full complement of inputs for components which you may have or may get in the future. The 42PW350 includes three HDMI and two component inputs for high-definition devices and a PC input which lets you use the set as a computer monitor. The USB input allows you to display photo slideshows and share MP3 audio files with your friends. In addition, the built-in ATSC/QAM/NTSC tuners receive virtually all available local digital and analog programs.\r\n\r\nNot only does the 42PW350 42"" LCD TV look good when you turn it on, but its glossy black cabinet complements any decor.\r\n\r\nThe Third Dimension\r\n    Bring your content to life with HD 3D technology. The astonishing effects will immediately grab your attention and bring your entertainment experience to the next dimension \r\n\r\nCapture Every Moment\r\n    Tired of streaky action or unclear plays during the game? See sports, fast action and video games like never before. The 600Hz Sub Field Driving virtually eliminates motion blur \r\n\r\nEnergy Star Qualified\r\n    Earning the Energy Star means a product meets strict energy efficiency guidelines set by the US Environmental Protection Agency and the Department of Energy. For TVs, it means they save energy both in standby and active (when they''re on) modes. Energy Star qualified TVs use about 30% less energy than standard units \r\n\r\nView It In The Right Light\r\n    Let your TV do the adjustments for you. Intelligent Sensor automatically optimizes the picture to the lighting and color conditions in the room for a more enjoyable viewing experience \r\n\r\nTruSlim Frame\r\n    At less than 1"" (25.4mm) wide the new TruSlim Frame trims away distraction of wide frame \r\n\r\nSee And Experience More\r\n    Pictures are sharper. Colors are more vibrant. Entertainment is more real. Everything looks better on an HDTV \r\n\r\nFind The Perfect Picture\r\n    Get easy self-calibration with on-screen reference points for key picture quality elements such as black level, color, tint, sharpness and backlight levels. Take the guesswork out of picture adjustments with this simple-to-use feature. It''s not actually magic, but it will sure seem that way \r\n\r\nWise And Not Wasteful\r\n    With Smart Energy Saving features, you can conserve money and energy \r\n\r\nVideo Features\r\n    Dual XD Engine: Yes\r\n    Aspect Ratio: 16:9\r\n    Aspect Ratio Correction: 5 Modes (16:9/Just Scan/Set by Program/4:3/Cinema Zoom)\r\n    Just Scan (1:1 Pixel Matching): HDMI: 1080p/1080i/720p, Component: 1080p/1080i/720p, RF: 1080i/720p\r\n    Color Temperature Control: 3 Modes (Warm/Medium/Cool)\r\n    Picture Mode: 10 Modes\r\n    ISFccc Ready: Yes\r\n    Sub-Field Driving: 600Hz\r\n    Picture Wizard II: Yes\r\n    AV Mode: Yes\r\n    Image Sticking Minimization (ISM): 3 Modes (White Wash/Orbiter/Color Wash)\r\n    24p Real Cinema (3:3 Pulldown): Yes\r\n    XD Color (Active Color Management): Yes\r\n    x.v. Color: Yes\r\n    DTV Signal Strength Indicator: Yes \r\n\r\nAudio Power\r\n    Bass/Treble/Balance Controls: Yes\r\n    Auto Volume Leveler II: Yes\r\n    Sound Modes: 5 Modes\r\n    Clear Voice II: Yes\r\n    Mono/Stereo/Dual (MTS/SAP): Yes \r\n\r\nSpecial Features\r\n    Smart Energy Saving: Yes\r\n    A/V Input Navigation: Yes\r\n    Input Labeling: Yes\r\n    Quick View (Flashback): Yes\r\n    Parental Control w/ V-Chip: Yes\r\n    Closed Caption (CC): Yes\r\n    SimpLink (HDMI CEC): Yes \r\n\r\nConvenience Features\r\n    Auto Tuning/Programming: Yes\r\n    Channel Add/Delete: Yes\r\n    Favorite Channel Programming: Yes\r\n    Auto/Manual Clock: Yes\r\n    On/Off Timer: Yes\r\n    Sleep Timer: Yes\r\n    Auto Off/Auto Sleep (When no video is present): Yes \r\n\r\n3D Specifications\r\n    3D: SG Type\r\n    2D to 3D: (20 Step Adjustability)\r\n    3D to 2D: Yes "\r\n', '', 'plain_text'),
('node', 'product', 0, 2, 2, 'und', 0, '"The LED3DTV4086 40"" Class 3D LED TV from Coby is up to the challenge of displaying Blu-ray native 3D discs or turning your 2D content into an immersive experience. Coby includes two pairs of 3D glasses with the LED TV. The combination of dynamic contrast (which delivers a ratio of 40,000:1) and full 1080p HD makes the LED3DTV4086 a remarkable TV by any standard. It also includes an advanced 120Hz motion engine, which generates lightning fast video while reducing motion blur.\r\n\r\nThe LED3DTV4086''s wide connectivity, which includes three HDMI connections, enables one-cable connection of your A/V components. In addition to all of the above, the LED3DTV4086 is loaded with convenience features like a sleep timer, parental control, closed captioning A/V input labeling and 3D deinterlace + 3D noise reduction. Lastly, the LED3DTV4086 delivers the next generation of home theater to you.\r\n\r\n    Delivers the next generation of home theater to its customers \r\n\r\n    Experience high resolution 3D with active shutter technology \r\n\r\n    Active shutter 3D glasses included \r\n\r\n    Advanced 120Hz motion engine generates lightning fast video while reducing motion blur \r\n\r\n    Enjoy video in stunning high resolution 1080p \r\n\r\n    LED technology for a thin and attractive design \r\n\r\n    Three high speed HDMI 1.4 connectors support the newest devices (and all existing devices) \r\n\r\n    Supports computer monitor connection \r\n\r\n    Extras - removable stand, closed caption (CC), V-chip, 3D deinterlace + 3D noise reduction, 3:2/2:2 reverse pull-down "\r\n', '', 'filtered_html'),
