('node', 'product', 0, 8, 8, 'und', 0, '"With HD 1080p resolution and SimpLink connectivity, the 50PZ550 50"" 3D 1080p Plasma TV from LG Electronics lets you tap into the virtual limitless possibilities of accessing movies, shows and info directly from the Internet.\r\n\r\nThe 50PZ550 yields images that truly show off any source material, be it Blu-ray movies, broadcast and cable TV, or video games. LG''s proprietary technologies also ensure that whatever you''re watching comes across in rich, detailed color. The 50PZ550 TV''s high contrast ratio and low response time make the unit capable of being the centerpiece in any home entertainment system.\r\n\r\nThe dynamic contrast ratio creates a sense of depth, fine gradation in color and tonal values and a general feeling of ""being there"" once thought impossible on a two-dimensional panel. LG''s 2D to 3D conversion feature adds a 3D effect to 2D television, movies, sports, video games and images, at the touch of a button.\r\n\r\nThe TV comes with a full complement of inputs for components which you may have or may get in the future. The 50PZ550 includes four HDMI and two component inputs for high-definition devices and a PC input which lets you use the set as a computer monitor. The USB inputs allow you to display photo slideshows and share MP3 audio files with your friends. In addition, the built-in ATSC/QAM/NTSC tuners receive virtually all available local digital and analog programs. Not only does the 50PZ550 50"" Plasma TV look good when you turn it on, but its glossy black cabinet complements any decor.\r\n\r\nThe Third Dimension\r\n    Bring your content alive with full 1080p HD 3D technology. The astonishing effects will immediately grab your attention and bring your entertainment experience to the next dimension \r\n\r\nPeel Away The Old Standard For Ultra Slim Framing\r\n    At less than 1"" (25.4mm) wide the new TruSlim Frame trims away distraction of wide frame \r\n\r\nCut Loose When You''re Wi-Fi Ready\r\n    Getting your LG TV connected to NetCast Entertainment Access and other online content is easy when you are Wi-Fi Ready. If you have existing wireless broadband, setting it up is simple and you don''t need to worry about messy wires \r\n\r\nMake Digital Devices Compatible\r\n    To build a digital network, you need digital devices. That''s obvious. But unless those devices are compatible, it won''t be much of a network. DLNA Certified devices work together \r\n\r\nEntertainment On Tap\r\n    NetCast Entertainment Access brings a multitude of Internet services direct to your TV-no computer required. Instantly access movies and TV shows, news and weather and the world''s largest library of HD movies in 1080p \r\n\r\nCapture Every Moment\r\n    Tired of streaky action or unclear plays during the game? See sports, fast action and video games in Full HD like never before. The 600Hz refresh rate virtually eliminates motion blur \r\n\r\nDouble The Detail\r\n    This stunning picture is the reason you wanted HDTV in the first place. With almost double the pixel resolution, Full HD 1080p gives it superior picture quality over standard HDTV. You''ll see details and colors like never before \r\n\r\nEnergy Star Qualified\r\n    Earning the Energy Star means a product meets strict energy efficiency guidelines set by the US Environmental Protection Agency and the Department of Energy. For TVs, it means they save energy both in standby and active (when they''re on) modes. Energy Star qualified TVs use about 30% less energy than standard units \r\n\r\nVideo Features\r\n    Dual XD Engine: Yes\r\n    Aspect Ratio: 16:9\r\n    Aspect Ratio Correction: 5 Modes\r\n    Just Scan (1:1 Pixel Matching): HDMI: 1080p/1080i/720p, Component: 1080p/1080i/720p, RF: 1080i/720p\r\n    Color Temperature Control: 3 Modes (Warm/Medium/Cool)\r\n    1080p Source Input: HDMI: 60p/30p/24p, Component: 60p/30p/24p, RGB: 60p (WXGA)\r\n    Picture Mode: 8 Modes\r\n    Picture Wizard II: Yes\r\n    AV Mode (Picture & Sound): Yes\r\n    Image Sticking Minimization (ISM): 3 Modes\r\n    24p Real Cinema (24p 5:5/2:2 Pull Down): 3:3 Pull Down (HDMI 1080 24p)\r\n    24p Real Cinema (3:3 Pulldown): Yes\r\n    HD Up-Converting: Yes\r\n    3:2 Pulldown: Yes\r\n    XD Color (Active Color Management): Yes\r\n    Expert Mode/ISFccc Ready: Yes\r\n    x.v. Color: Yes\r\n    DTV Signal Strength: Yes \r\n\r\nAudio Features\r\n    Dolby Digital Decoder: Yes\r\n    Surround System: Infinite Sound\r\n    Bass/Treble/Balance Controls: Yes\r\n    Auto Volume Leveler II: Yes\r\n    Mono/Stereo/Dual (MTS/SAP): Yes\r\n    Sound Modes: 5 Modes (Standard/Music/Cinema/Games/Sports)\r\n    Clear Voice II: Yes \r\n\r\n3D Specifications\r\n    3D: SG\r\n    Compatible 3D Glasses: AG-S250 Only\r\n    2D to 3D: Yes (2D Step Adjustability)\r\n    3D to 2D: Yes\r\n    3G Glasses (AG-S250) Compatible: (Not included) \r\n\r\nSpecial Features\r\n    Smart Energy Saving: Yes\r\n    Intelligent Sensor: Yes\r\n    Wi-Fi Ready: Yes (Adapter required, sold separately)\r\n    NetCast Entertainment Access: Yes\r\n    A/V Input Navigation: Yes\r\n    Input Labeling: Yes\r\n    Screen Adjust: Yes\r\n    Quick View (Flashback): Yes\r\n    Picture Freeze: Yes\r\n    Parental Control w/ V-Chip: Yes\r\n    Closed Caption (CC): Yes\r\n    SimpLink: Yes (All HDMI) \r\n\r\nConvenience Features\r\n    Auto Tuning/Programming: Yes\r\n    Channel Add/Delete: Yes\r\n    Favorite Channel Programming: Yes\r\n    Auto/Manual Clock: Yes\r\n    On/Off Timer: Yes\r\n    Sleep Timer: Yes\r\n    Auto Off/Auto Sleep: Yes\r\n    Color Reproduction (Panel Output): 16-bit\r\n    ISM (Image Sticking Minimization): (White Wash/Orbiter/Color Wash) "\r\n', '', 'plain_text'),
('node', 'product', 0, 9, 9, 'und', 0, '"The 50PZ750 50"" 1080p 3D Plasma Smart TV from LG is the perfect blend of design, price and performance in a superb TV. Full HD 1080p resolution, 3M:1 dynamic contrast ratio, and incredibly fast sync time give you pictures that make the most out of any media you are using. LG''s 600Hz Sub Field Driving ensures that fast-moving content is delivered in vivid color and striking detail so nothing goes by in a blur. The mega dynamic contrast ratio creates a sense of depth, fine gradation in color and tonal values and a general feeling of ""being there"" once thought impossible on a two-dimensional panel. LG''s 2D to 3D conversion feature adds a 3D effect to 2D television, movies, sports, video games and images, at the touch of a button.\r\n\r\nThe 50PZ750 comes with a full complement of inputs, ensuring that you''ll be able to hook up any equipment you have or may get in the future. The unit includes four HDMI and two component jacks for high-definition devices. And if one of those devices happens to be a gaming console, gamers will be happy to know that game mode, which speeds up the scaling process, virtually eliminates video lag time.\r\n\r\nIn addition, the built-in ATSC/Clear QAM tuning system receives any type of cable service, including high definition. The 50PZ750 is also wireless 1080p ready as well.\r\n\r\nSo Smart, It''s Simple\r\n    A revolutionary easy way to access limitless content, thousands of movies, customizable apps, videos and the best of the web all organized in a simple to use interface. And, when you can just point and choose selections with LG''s unique motion-controlled Magic Remote, it''s even simpler. That''s what you get with an LG Smart TV experience, the next generation in entertainment organized within a simple interface \r\n\r\nTHX Certified\r\n    To earn THX 3D Display certification, the 50PZ750 50"" 1080p 3D Plasma Smart TV passed more than 30 rigorous tests, ensuring you''re bringing an uncompromised 3D HD experience home-just like the director wanted it \r\n\r\nWorks Like Magic\r\n    Selecting features on your TV is as easy as the wave of your hand with the Magic Motion remote control. Just point to what you want and the sensors follow right along. Clicking and scrolling is soon to be a thing of the past \r\n\r\nMake Digital Devices Compatible\r\n    To build a digital network, you need digital devices. That''s obvious. But unless those devices are compatible, it won''t be much of a network. DLNA Certified devices work together \r\n\r\nThe Third Dimension\r\n    Bring your content alive with full 1080p HD 3D technology. The astonishing effects will immediately grab your attention and bring your entertainment experience to the next dimension \r\n\r\nCapture Every Moment\r\n    Tired of streaky action or unclear plays during the game? See sports, fast action and video games in Full HD like never before. The 600Hz refresh rate virtually eliminates motion blur \r\n\r\nDouble The Detail\r\n    This stunning picture is the reason you wanted HDTV in the first place. With almost double the pixel resolution, Full HD 1080p gives it superior picture quality over standard HDTV. You''ll see details and colors like never before \r\n\r\nVideo Features\r\n    Dual XD Engine: Yes\r\n    Aspect Ratio: 16:9\r\n    Aspect Ratio Correction: 5 Modes (16:9/Just Scan/Original/4:3/Cinema Zoom)\r\n    Color Temperature Control: 3 Modes (Warm/Medium/Cool)\r\n    Picture Mode: 10 Modes\r\n    xvYCC: Yes\r\n    24p Real Cinema (3:3 Pulldown): Yes (HDMI 1080 24p)\r\n    Cinema 3:2/2:2 Pull Down Mode: Yes\r\n    HD Up-Converting: Yes\r\n    AV Mode: Yes (Cinema/Game/Sport)\r\n    XD Color (Active Color Management): Yes\r\n    ISFccc Ready: Yes\r\n    Intelligent Sensor Mode: Yes\r\n    DTV Signal Strength: Yes\r\n    Just Scan (1:1 Pixel Matching) 0% OverScan: HDMI: 1080p/1080i/720p, Component: 1080p/1080i/720p, RF: 1080i/720p \r\n\r\nAudio Features\r\n    Mono/Stereo/Dual (MTS/SAP): Yes\r\n    Audio Output Power (Watts - THD 10%): 10W + 10W\r\n    Speaker System Details: 2 Speakers, 1 Way\r\n    Dolby Digital Decoder: Yes\r\n    Surround System: Infinite Surround\r\n    Bass/Treble/Balance Controls: Yes\r\n    Clear Voice II: Yes\r\n    Auto Volume Leveler II: Yes\r\n    Sound Modes: 5 Modes (Standard/Music/Cinema/Games/Sports) \r\n\r\n3D Specifications\r\n    3D: SG\r\n    2D to 3D: Yes (2D Step Adjustability)\r\n    3D to 2D: Yes \r\n\r\nConnectivity Features\r\n    LG Smart TV: Yes\r\n    LG App Store: Yes\r\n    Web Browser: Yes\r\n    DLNA Certified: Yes (Movie/Photo/Music)\r\n    Windows 7 Certified: Yes\r\n    Magic Motion Remote: Yes \r\n\r\nSpecial Features\r\n    Picture Wizard II: Yes\r\n    Smart Energy Saving: Yes\r\n    1080p Source Input: HDMI: 60p/30p/24p, Component: 60p/30p/24p, RGB: 60p (WXGA)\r\n    A/V Input Navigation: Yes\r\n    Input Labeling: Yes\r\n    Screen Adjust: Yes\r\n    Quick View (Flashback): Yes\r\n    Picture Freeze: Yes\r\n    Parental Control w/ V-Chip: Yes\r\n    Closed Caption (CC): Yes\r\n    Wi-Fi Ready: Yes (Adapter required, sold separately)\r\n    SIMPLINK: Yes (All HDMI)\r\n    Protective Skin Glass\r\n    ISM (Image Sticking Minimization): (White Wash/Orbiter/Color Wash) \r\n\r\nConvenience Features\r\n    Auto Tuning/Programming: Yes\r\n    Channel Add/Delete: Yes\r\n    Favorite Channel Programming: Yes\r\n    Auto/Manual Clock: Yes\r\n    On/Off Timer: Yes\r\n    Sleep Timer: Yes\r\n    Auto Off (Sleep): Yes "\r\n', '', 'filtered_html'),
