('node', 'product', 0, 37, 37, 'und', 0, 'The AKG C 2000B is the "entry level" model for anyone looking for an affordable high quality recording microphone. Its almost ruler-flat response provides a crystal-clear, "up-front" sound. A switchable bass roll-off filter for eliminating proximity effect and a switchable 10dB pre-attenuation pad let you adjust the C 2000B''s response to all recording or live miking situations. A built-in pop screen reduces unwanted noise that may be caused by plosive sounds if you use the microphone extremely close-in. Rugged construction, an elegantly styled die-cast metal housing, and silver-gray finish add to the professional level quality of the C 2000B.', '', 'plain_text'),
