('node', 'page', 0, 51, 51, 'und', 0, '<div class="center_title_bar">Contact Us</div>\r\n<div style="clear:both"></div>\r\n<div class="body_content">\r\n<b>Corporate Headquarters\r\nChennai\r\nPhoton Infotech Pvt. Ltd.</b>\r\nDLF IT Park, Block VI,\r\n2nd,6th,7th & 8th floor,\r\nChennai- 600089\r\nTamil Nadu, India\r\nPhone: 044-30618000 EXTN:1000\r\nUS Call Back Number: 1408-404-3301\r\n<hr class="contact_margin">\r\n<b>Bangalore\r\nPhoton Infotech Pvt. Ltd.</b>\r\nAdarsh Tech Park-SEZ,\r\nBellandur Post,\r\nBangalore- 583471\r\nKarnataka, India\r\nPhone: 080-39216500\r\nUS Call Back Number: 1408-404-3301\r\n<hr class="contact_margin">\r\n<b>San Jose\r\nPhoton Infotech Inc.</b>\r\n100 Century Center Court, #502,\r\nSan Jose- 95112\r\nCA, USA\r\nPhone: 1-408-404-3301\r\n<hr class="contact_margin">\r\n<b>Somerville\r\nPhoton Infotech Inc.</b>\r\n68 E. Main Street,,\r\nSomerville, - 08876\r\nNJ, USA\r\nPhone: 1-908-722-4942\r\n<hr class="contact_margin">\r\n<b>\r\nNew York\r\nPhoton Infotech Inc.</b>\r\n512 Seventh Ave,,\r\n42nd Floor,\r\nNew York- 10018\r\nNY, USA\r\nPhone: 1-408-404-3301\r\n<hr class="contact_margin">\r\n<p>\r\n<b>Contact Sales</b>\r\ne-Mail: sales@photoninfotech.net\r\nPhone: +1 408-404-3301\r\n</p>\r\ne-Fax: +1 408 877 1532\r\n</div>', '', 'full_html'),
('node', 'page', 0, 52, 52, 'und', 0, '<div class="center_title_bar">About Us</div>\r\n<div style="clear:both"></div>\r\n<div class="body_content">\r\n<p><b>OUR PHRESCO DRUPAL ESHOP MISSION</b> is to value every moment, everything and everyone involved with us and the way we conduct business, to move towards:</p>\r\n<br />\r\n<p>All our products are made from super-100% (ELCOT) certified electronics products we play fair from start to finish. </p>\r\n<br />\r\n<p>We start with notebook farming, we then hand pick the best electronic goods. Then, we manufacture our products from the finest electronics companies, and throughout the manufacturing process, we use paddy husk as a source of energy. We recycle the excess product material from the process; and play fair throughout, for we believe in our people and our process. </p>\r\n<br />\r\n<p>\r\n<b>OUR PRODUCTS:</b>\r\n- are UNIQUE. we design exclusive prints, patterns and designs from scratch, that you wouldn''t find anywhere else.\r\n- are FASHION-FORWARD. we keep the future in mind.\r\n- are FUNCTIONAL. many of our products are reversible and multi-functional.\r\n- are COMFORTABLE. We use the softest plastic and use tag-less labels where possible.\r\n</p>\r\n\r\n</div>\r\n', '', 'full_html'),
('node', 'product', 0, 53, 53, 'und', 0, 'NVIDIA Tegra 250 Dual-Core Processor \r\nActive Matrix 10.1"" TFT Color LCD Screen \r\nWidescreen HD WXGA 1280 x 800 Resolution \r\nDDR2 SDRAM 1GB Memory & 16GB of Storage \r\nAndroid 3.0 Honeycomb Operating System \r\nWiFi 802.11 b/g/n & Bluetooth Enabled \r\nMicro-HDMI & High-Speed USB 2.0 Port \r\nFront 2MP Camera & Back 5MP Camera \r\nNVIDIA GeForce Graphics \r\nDual Speakers & Dolby Mobile Technology .\r\nThe Acer 16GB Iconia Tab A500 10.1"" Multi-Touch Screen Tablet is an ultra-portable tablet equipped with a high-definition 10.1"" Active Matrix TFT color LCD display with cinematic WXGA 1280 x 800 resolution. It runs the Android 3.0 Honeycomb operating system with an NVIDIA Tegra 250 dual-core processor capable of a 1.0GHz processing speed. It supports NVIDIA GeForce graphics and has an internal 1GB DDR2 SDRAM memory, as well as 16GB of storage capacity that can be expanded by utilizing the MicroSD/SDHC card slot.', '', 'plain_text'),
('node', 'product', 0, 54, 54, 'und', 0, 'nVidia Tegra 250 Dual-Core 1.0GHz CPU \r\nActive Matrix 7.0"" TFT Color LCD Screen \r\nWXGA 1024 x 600 HD Resolution \r\nInternal 8GB Storage & 1GB DDR2 SDRAM \r\nWiFi 802.11 b/g/n & Bluetooth 2.1 + EDR \r\nAndroid Honeycomb Operating System Brilliant nVidia GeForce Graphics Micro HDMI Port & Micro USB 2.0 Port Dolby Mobile Technology & Dual Speakers MicroSD & MicroSDHC Memory Card Reader \r\nThe Acer 8GB Iconia Tab A100 VanGogh 7.0"" Multi-Touch Tablet PC (Steel Blue) is an ultra-portable tablet equipped with a high-definition 7.0"" Active Matrix TFT color LCD multi-touch display that supports cinematic WXGA 1024 x 600 resolution. It features an Android Honeycomb operating system, nVidia Tegra 250 Dual-Core 1.0GHz mobile processor and stunning nVidia GeForce graphics. The A100 utilizes a generous 1GB of DDR2 SDRAM internal memory to ensure fast computing. For storing documents and media, the tablet features a sufficient 8GB storage capacity, which can easily be expanded by taking advantage of the integrated MicroSD/MicroSDHC memory card slot.', '', 'plain_text'),
