(11, 'node', ' apple 116 macbook air notebook computer  80000 the 116 macbook air notebook computer from apple is an extremely portable stunningly designed laptop computer apple s engineers have leveraged the lessons they learned in designing the miniaturized ipad and applied them to the design of this 23pound computer the original macbook air s slim profile was made possible due to the lack of an optical drive this system eschews the hard drive as well opting instead for 128gb of flash storage resulting in an even slimmer profile when closed the computer is only 68 at its thickest point flash storage doesn t just give you a lighter thinner computer it also allows for impressive battery life up to 5 hours of web browsing and an amazing 30 days of standby time the macbook air is housed in an aluminum unibody enclosure which is as strong as it is light because it is cut from a solid block of aluminum the housing is stronger than those found on laptops built via traditional means the computer s highresolution display makes working on the go a breeze at 116 in size the 169 display feature a native resolution of 1366 x 768 greater than that of the 133 macbook pro it features a glossy finish and a led backlight for enhanced image quality and energy efficiency computers in the macbook air s weight class are most often classified in the netbook category netbooks typically feature lessthanfullsize keyboards cramped trackpads and lowpowered cpus not so with the macbook air this computer features the same chiclet keyboard found on every computer in the macbook series it also boasts a large multitouch glass trackpad giving you full control over your computer without sacrificing ergonomics the computer is powered by a dualcore 14ghz intel core 2 duo processor and boasts 2gb of ram graphics are provided by an integrated nvidia geforce 320m gpu with up to 256mb of shared ddr3 memory the computer features all the amenities you expect on a mac a facetime webcam dualband 80211n airport extreme wifi bluetooth 21 edr and builtin stereo speakers ilife 11 has a complete suite of digital creativity applications easy enough for anyone to use ilife will help you edit your home movies organize digital photos and compose original music the 64bit os features time machine backup which automatically backs up system data to an external hard drive it also features intuitive cover flow navigation the powerful spotlight search tool and quick look document preview you ll be able to use boot camp to run windows on your mac or facetime to participate in video chats with iphone ipod touch and mac users note to apple s os upgrade the preinstalled os may be mac os x 106 snow leopard or os x 107 lion apple computers purchased on or after july 21 2011 can be upgraded to lion via free download from the mac app store within 30 days of purchase design everything apple has learned has come down to this apple learned a lot from ipad the new macbook air is proof it s designed around allflash storage for better responsiveness and reliability it features a trackpad with full multitouch support and though it s incredibly thin and light its large battery gives you portable power that lasts for hours advanced technology from ipad taken to the air a truly mobile device needs to be light thin and strong enough to take with you wherever you go it also needs to perform quickly spring to life instantly and have enough battery power to keep up with you it should have no spinning hard drive no optical drive and no unnecessary parts all of that is true of ipad and now it s true of apple s most mobile notebook ever macbook air outofthebox flash storage macbook air continues its legacy of firsts with something entirely new for any mac flash storage standard in fact the new macbook air is designed completely around flash storage but in a totally different way typically flash storage is housed in a package that s the same size as a conventional hard drive yet the flash chips themselves occupy a very small portion of that housing getting rid of the hard drive enclosure and using only the parts that matter the actual flash chips frees up about 90 percent more space and just like that there s room for other important things like a bigger battery now you have a notebook that weighs practically nothing and runs for hours on a single charge that s mobility mastered the best way to multitouch on a notebook no one knows multitouch technology better than apple introduced with the very first iphone and taken even further with ipad multitouch is now part of practically every apple device it s simply the best and most personal way to interact with your software and the optimal way to experience multitouch on a notebook is through a trackpad that s precisely the case with macbook air now you can perform more gestures than you have fingers on a spacious allglass surface that s smooth to the touch an incredible battery case closed or open if you looked inside macbook air you d see something remarkable how much space was devoted to the battery apple engineers were able to fit all the computer components on one of our smallest logic boards ever removing the flash storage enclosure and placing the flash chips on the logic board freed up even more room and voila space for a bigger battery so you can get up to 5 hours of battery life on this 116 macbook air and when you put macbook air to sleep for more than an hour it enters what s called standby mode so you can come back to macbook air a day a week even up to an entire month later and it wakes in an instant time is on your side courtesy of macbook air unibody in unison when macbook air first debuted it was groundbreaking in many ways chief among them was the precision unibody enclosure now that same engineering process comes to the macbook air display just like the main enclosure the display housing is crafted from a single piece of aluminum with all the structural elements machined directly into it total unibody construction means a less complex design with fewer parts that makes macbook air exceptionally thin and light yet still durable enough to handle the rigors of everyday use facetime camera the facetime camera inside the macbook air unibody display is even thinner than the one inside iphone 4 features allflash storage instanton gratification if you have an ipod iphone or ipad you re already taking advantage of all that flash storage has to offer reliability speed and efficiency so the decision to use flash storage in an ultracompact notebook like macbook air makes perfect sense flash allows you to access data quickly and it gives macbook air the astonishing ability to remain in standby mode for up to 30 days which means your macbook air snaps to in an instant whether you open it tomorrow next week or next month multitouch trackpad it s love at first click tap and scroll the macbook air includes a spacious multitouch trackpad with a buttonless design so you can click anywhere the multitouch trackpad also lets you pinch swipe or rotate to adjust an image zoom in on text or advance through a photo album try the fourfinger swipe swiping up or down to use exposé and swiping left or right to switch among active applications or perform the threefinger drag to move your windows from one place to another longlasting battery instant on even after a month off since spacesaving flash storage leaves room for a bigger battery you can devote more time to the things you enjoy most things like browsing the web editing photos and watching videos get up to 5 hours of battery life on a single charge put macbook air to sleep and it enters standby mode to conserve battery life for up to 30 days when you come back to your macbook air and open it up it s on in an instant so you re free to go off the grid knowing you re still on a charge highresolution display millions of pixels millimeters thin corner to corner and pixel by pixel the display on the macbook air is both an engineering feat and a design breakthrough it measures a mere 486 millimeters 19 inch thin yet the resolution is so high you ll feel like you re looking at a much larger screen and with good reason the 116 macbook air features a widescreen 169 aspect ratio and a 1366 x 768 native resolution greater than that of the 133 macbook pro facetime camera hello iphone you too ipod touch hidden inside the waferthin macbook air display is another engineering achievement the facetime camera it s so thin even thinner than the camera on iphone 4 you barely notice it but it s incredibly capable using the new facetime for mac application currently in beta you can make facetime calls over wifi with anyone who has a mac an iphone 4 or the new ipod touch and the video quality is so good you can even chat in lowlight conditions stereo speakers heard not seen despite its compact form macbook air delivers full stereo sound spaceefficient design inside the enclosure allows for the placement of left and right speakers that project sound through the keyboard so you re able to enjoy a richer audio experience while chatting online watching tv shows listening to music or playing games nvidia geforce graphics power in motion macbook air features the nvidia geforce 320m graphics processor the same one used in the 133 macbook pro with a performance boost of over two times that of the previousgeneration macbook air the nvidia graphics processor provides outstanding speed and power for browsing photos watching movies or playing games it also makes all the everyday things you do on macbook air like writing email and browsing the web fast and energy efficient intel core 2 duo processors small in size big on performance macbook air weighs less than three pounds but it s a heavyweight where it counts intel core 2 duo processors get the work done fast so you can be every bit as productive on macbook air but in more places liveblog the event of the year straight from the convention floor perfect your saleswinning presentation from the airport terminal cite references down to a t from the library stacks macbook air lets you do everything you need to do whenever and wherever it needs to be done connectivity you re free to go to be truly mobile you need to go wireless that s why macbook air features 80211n wifi and bluetooth 21 edr wireless connectivity allows you to browse the web send email and print documents it also lets you download music videos and coming soon with the mac app store applications no matter where you are macbook air has you covered when you re staying in one place for a while too two usb 20 ports and a headphone minijack give you plenty of options and a mini displayport connects to a 27 apple led cinema display projector or hdtv for those times when you re looking to broaden your desktop horizon dvd or cd sharing without a builtin optical drive how do you install new applications simply use dvd or cd sharing this convenient feature of mac os x lets you wirelessly borrow the optical drive of a nearby mac or pc so you can install applications from a dvd or cd and have full access to an optical drive without having to carry one around performance powerful nvidia graphics the macbook air features the fastest integrated graphics on the market the nvidia geforce 320m graphics processor with 48 processing cores boasts a performance gain of over two times when compared to the previousgeneration macbook air that makes a huge difference when you re firing up graphicsintensive applications or playing 3d games like eve or call of duty 4 speaking of huge connect a 27 apple led cinema display to macbook air and marvel at how the nvidia geforce 320m drives over four million pixels of eyepopping color onscreen fast intel processors it may be hard to believe that a computer so slim is capable of keeping up with your everyday tasks but this one is with an intel core 2 duo processor and 3mb of shared l2 cache macbook air runs your applications smoothly and efficiently so you can do everything you normally use a computer for touch up your photos edit home movies create presentations send email play games and all the other little and big tasks in between on a notebook that weighs less than a sunday paper allflash storage wow that was fast with macbook air you ll find yourself saying that a lot because flash storage is two times faster than a conventional hard drive everything you do is more responsive browsing a large photo library launching applications opening files and waking macbook air from sleep for instance and flash storage doesn t have any moving parts which means it s more reliable and it s also quiet lightning fast durable silent fitting qualities for an ultracompact notebook like macbook air longlasting battery take macbook air with you to the office to school to wherever and you ll be amazed at how far it will take you the macbook air has a battery that lasts up to 5 hours and while you may never pry yourself away from your notebook for up to 30 days with macbook air you can if you want to standby mode gives macbook air the ability to wake instantly from days even weeks of standby with battery life to spare the mac experience every day use every mac is designed to make your life easier not more difficult the macbook air gives you all the tools you need for email personal organization internet browsing watching movies and more its software and hardware are designed work to together seamlessly eliminating the compatibility nightmares that often plague pc users what s more the macbook air can run windows via boot camp perfect for users who have a windowsonly application that they absolutely need to use ilife 11 ilife 11 is a suite of applications that help you organize your digital life it includes iphoto for photo management and editing imovie for hd video editing and garageband for music production secure and reliable worried about viruses and malware don t be the macbook air isn t plagued by constant attacks from the outside world it is designed to be secure out of the box eliminating the need for additional software to protect your system from danger os x will warn you if a downloaded file is potentially dangerous ensuring that you don t accidentally open a malicious application apple responds quickly to any security threats prompting you to download updates that keep your mac up to date and safe advanced technology standard powered by an intel dualcore cpu the macbook air is fully loaded with flash storage 3d graphics a facetime camera bluetooth and wifi you ll find features on this system that are foreign to the pc world including the magsafe power adapter design environmentally friendly design apple understands that the earth is our most precious resource they ve worked to create a computer that is energy efficient free of many toxins and highly recyclable because apple designs both hardware and software the macbook air is able to use a highly efficient power supply that reduces wasted power the computer is free of mercury and arsenic and its internal components are free of polyvinyl chloride pvc and brominated flame retardants bfrs when the computer reaches the end of its long life you can rest assured that it can be recycled it is constructed from materials that are highly desirable to recyclers the macbook air has been awarded epeat gold status for responsible manufacture energy efficiency and recyclability tech support have a problem with your mac get support and advice at the genius bar located at every apple retail store apple also provides online tutorials troubleshooting forums and 90 days of phone support for users who aren t able to make it to an apple store optional applecare apple provides 90 days of free phone support and a 1year limited hardware warranty on the computer you can opt to add an applecare protection plan at additional cost which covers support and repairs for 3 years from the date of purchase applecare can be purchased at any time within the first year of ownership of the computer sku 1011 apple list price 86900 computers no price 80000 weight  kg dimensions  in  in  in  ', 0),
